/* eslint-disable no-unused-vars */
import React, {useState} from "react";
import DataReminder from "../Reminderdata";
import ListPeople from "../Reminderlist/ListPeople";
import Reminder from "../Reminder";


const IncludesReminder = () => {
  const [People , setPeople ] = useState(DataReminder);




  return (
    <main>
      <section className="container">
        <ListPeople People={People} />
      </section>
    </main>
  );
}; 

export default IncludesReminder;
